			84,
			85,
			91,
			172,
		];
		const sprite = document.getElementById('sprite');
		for (let i = 0; i < 176; ++i) {
			let frame = document.createElement('div');
			frame.classList.add('frame');

			if (unused.indexOf(i) !== -1) {
				frame.classList.add('unused');
			}

			let row = Math.floor(i / 16);
			let col = i % 16;
			frame.style.backgroundPosition = (col * -40) + 'px ' + (row * -40) + 'px';

			frame.setAttribute('data-id', "#" + i);

			sprite.appendChild(frame);
		}
	</script>
</body>
</html>
